(29, 'unsubscribed_user', NULL, NULL, NULL, 1, NULL, 15, 'Confirmation: Canceled subscription', 'Local Dope LLC', '<h4>You\'ve canceled your subscription to <span class=\"theme-color\">Local Dope LLC</span>.</h4>\n<hr>\n<ul style=\"width: 100%\">\n    <li>Subscription name: <h3>test plan</h3></li>\n\n    <li>Confirmation ID: <p style=\"color: black\">sub_CWS05ydTFwqW2a</p></li>\n\n</ul>\n\n<hr>\n<div class=\"row text-center\">\n            <div class=\"col-12\">\n            <h3 class=\"text-center\">Local Dope LLC thanks you</h3>\n        </div>\n        <div style=\"margin: auto; margin-bottom: 5px; width: 200px; height: 200px; background: url(http://localhost:8888/business/logos/8OxEy0Xm4pS6cDpKHo04G7PN2oYeH99fY294gs2A.jpeg) no-repeat; background-size: contain\"> </div>\n    </div>', '2018-03-20 13:12:55', '2018-03-20 13:12:55', '0', '0', 'notifications.templates.unsubscribed-user'),
(37, 'notify_plan_deletion', NULL, NULL, NULL, 1, NULL, 17, 'Subscription canceled. Service no longer available', 'Local Dope LLC', '<h4>Heads up! A subscription you own will be cancelled because we have removed it from our services:</h4>\n<hr>\n<ul style=\"width: 100%\">\n    <li>Subscription name: <h3>new test</h3></li>\n\n    <li>Confirmation ID: <p style=\"color: black\">sub_CX4cjzqcWkPZ6y</p></li>\n\n    <li>Refund Status: A refund will be issued to your bank card</li>\n\n</ul>\n\n<p>We apologize for any inconvenience this may have caused</p>\n<hr>\n<div class=\"row text-center\">\n            <div class=\"col-12\">\n            <h3 class=\"text-center\">Local Dope LLC thanks you</h3>\n        </div>\n        <div style=\"margin: auto; margin-bottom: 5px; width: 70px; height: 70px; background: url(http://localhost:8888/business/logos/8OxEy0Xm4pS6cDpKHo04G7PN2oYeH99fY294gs2A.jpeg) no-repeat; background-size: contain\"> </div>\n    </div>', '2018-03-22 12:44:08', '2018-03-22 12:44:08', '0', '0', 'notifications.templates.notify-plan-deletion'),
(40, 'notify_plan_deletion', NULL, NULL, NULL, 1, NULL, 18, 'Subscription canceled. Service no longer available', 'Local Dope LLC', '<h4>Heads up! A subscription you own will be cancelled because we have removed it from our services:</h4>\n<hr>\n<ul style=\"width: 100%\">\n    <li>Subscription name: <h3>test yos</h3></li>\n\n    <li>Confirmation ID: <p style=\"color: black\">sub_CXR6lAAhBrl7dK</p></li>\n\n    <li>Refund Status: A refund will be issued to your bank card</li>\n\n</ul>\n\n<p>We apologize for any inconvenience this may have caused</p>\n<hr>\n<div class=\"row text-center\">\n            <div class=\"col-12\">\n            <h3 class=\"text-center\">Local Dope LLC thanks you</h3>\n        </div>\n        <div style=\"margin: auto; margin-bottom: 5px; width: 70px; height: 70px; background: url(http://localhost:8888/business/logos/8OxEy0Xm4pS6cDpKHo04G7PN2oYeH99fY294gs2A.jpeg) no-repeat; background-size: contain\"> </div>\n    </div>', '2018-03-22 12:46:07', '2018-03-22 12:46:07', '0', '0', 'notifications.templates.notify-plan-deletion'),
(42, 'unsubscribed_user', NULL, NULL, NULL, 1, NULL, 6, 'Confirmation: Canceled subscription', 'Local Dope LLC', '<h4>You\'ve canceled your subscription to <span class=\"theme-color\">Local Dope LLC</span>.</h4>\n<hr>\n<ul style=\"width: 100%\">\n    <li>Subscription name: <h3>newr</h3></li>\n\n    <li>Confirmation ID: <p style=\"color: black\">sub_CYXxBnUYI1DlWq</p></li>\n\n</ul>\n\n<hr>\n<div class=\"row text-center\">\n    </div>', '2018-03-25 11:56:52', '2018-03-25 11:56:52', '0', '0', 'notifications.templates.unsubscribed-user'),
(44, 'notify_business_modification', NULL, NULL, NULL, 1, NULL, 7, 'Welcome to Otruvez!', 'Local Dope LLC', '<h4>We thought you should know that we changed some of the details for our business. Your subscriptions will not be affected.</h4>\n<h5>The details are below</h5>\n\n<hr>\n<div class=\"card\">\n    <div class=\"card-body\">\n        <h3 class=\"text-justify\">Local Dope LLC</h3>\n        <p><i>\"this is a description\"</i></p>\n        <p>ib708090@gmail.com</p>\n        <p>5623700559</p>\n        <p>555e East Ocean Boulevard, Long Beach, CA, USA</p>\n        <h5><b><u>Business hours</u></b></h5>\n        <div class=\"business-hours\" style=\"display: block\">\n                            <div class=\"edit-label-div\">\n                    <label>Monday</label>\n                </div>\n                <div class=\"edit-input-div\">\n                    <p></p>\n                </div>\n\n                            <div class=\"edit-label-div\">\n                    <label>Tuesday</label>\n                </div>\n                <div class=\"edit-input-div\">\n                    <p></p>\n                </div>\n\n                            <div class=\"edit-label-div\">\n                    <label>Wednesday</label>\n                </div>\n                <div class=\"edit-input-div\">\n                    <p></p>\n                </div>\n\n                            <div class=\"edit-label-div\">\n                    <label>Thursday</label>\n                </div>\n                <div class=\"edit-input-div\">\n                    <p></p>\n                </div>\n\n                            <div class=\"edit-label-div\">\n                    <label>Friday</label>\n                </div>\n                <div class=\"edit-input-div\">\n                    <p></p>\n                </div>\n\n                            <div class=\"edit-label-div\">\n                    <label>Saturday</label>\n                </div>\n                <div class=\"edit-input